import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the "Sort and Filter Controls" container by label text
    await page.waitForSelector('label[for="sortSelect"]', { timeout: 5000 });

    // Find the List View button using its icon (fa-list) and button role
    // Try to find the button with a <i> that has class "fa-list"
    const listBtn = await page.waitForSelector(
      '//button[.//i[contains(@class,"fa-list")]]',
      { timeout: 5000 }
    );

    // Take screenshot before switching view
    const beforeSwitchShot = path.join(screenshotsDir, 'step_2_before_switch.png');
    await page.screenshot({ path: beforeSwitchShot });
    screenshots.push(beforeSwitchShot);

    // Click the List View button
    await listBtn.click();

    // Wait for the products to be rendered in list mode (look for .products-list)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching view
    const afterSwitchShot = path.join(screenshotsDir, 'step_3_list_view.png');
    await page.screenshot({ path: afterSwitchShot });
    screenshots.push(afterSwitchShot);

    // Extract a sample of product titles in list view to verify
    const productTitles = await page.$$eval('.products-list .product-title', nodes =>
      nodes.map(n => n.textContent.trim()).slice(0, 5)
    );

    return {
      success: true,
      action: "Switched to List View Mode using the List View button in the sort/filter controls.",
      extractedData: {
        productTitlesSample: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
